@pink1111moon The article, “God particles in the perspective  of The AlQuran Surah Yunus: 61 and modern science,” appeared in the Journal of Physics: Conference Series, which in 2017 published submissions to the 2016 International Conference on Science and Applied Science (Engineering and Educational Science), held in Indonesia. It was authored by Sri Jumini, of the Physics Department Program of Sains AlQuran University in Java.
10: 61 Al Quran 
There is no activity you may be engaged in ˹O Prophet˺ or portion of the Quran you may be reciting, nor any deed you ˹all˺ may be doing except that We are a Witness over you while doing it. Not ˹even˺ an atom’s weight is hidden from your Lord on earth or in heaven; nor anything smaller or larger than that, but is ˹written˺ in a perfect Record.1
